import React, { useState, useEffect } from 'react';
import axios from 'axios';
import '../style/UserPage.css'; // Import CSS file

const UserPage = ({role, onChangePage}) => {
    const [users, setUsers] = useState([]);
    const [employees, setEmployees] = useState([]);
    const [selectedRow, setSelectedRow] = useState(null);

    useEffect(() => {
        // Fetch data from Java Spring backend
        axios.get('http://localhost:8080/users/list')
            .then(response => {
                setUsers(response.data);
            })
            .catch(error => {
                console.error('Error fetching user data:', error);
            });

        axios.get('http://localhost:8080/employee/list')
            .then(response => {
                setEmployees(response.data);
            })
            .catch(error => {
                console.error('Error fetching employee data:', error);
            });
    }, []);

    const handleRowClick = (userId) => {
        setSelectedRow(userId);
    };

    const handleDelete = (id) => {
        axios.delete(`http://localhost:8080/plant/deleteById?id=${id}`)
            .then(response => {
                console.log(response.data);
                this.setState(prevState => ({
                    plants: prevState.plants.filter(plant => plant.id !== id)
                }));
            })
            .catch(error => {
                console.error('Error deleting data:', error);
            });
    };

    handleEdit = (plantId) => {
        const { role, onChangePage } = this.props;
        onChangePage(role, 4, plantId, 0);
    };

    return (
        <div className="UserPage">
            <h1>Users</h1>
            <table>
                <thead>
                <tr>
                    <th>No.</th>
                    <th>First name</th>
                    <th>Last name</th>
                    <th>Date of birth</th>
                    <th>Address</th>
                    <th>Phone number</th>
                    <th>Email</th>
                    <th>Username</th>
                    <th>Password</th>
                    <th>Admin status</th>
                    <th>Actions</th>
                </tr>
                </thead>
                <tbody>
                {users.map(user => (
                    <tr key={user.userId}
                        onClick={() => handleRowClick(user.userID)}
                        className={selectedRow === user.userID ? 'selected' : ''}>
                        <td>{user.userID}</td>
                        <td>{employees.at(user.person).firstName}</td>
                        <td>{employees.at(user.person).lastName}</td>
                        <td>{employees.at(user.person).dateOfBirth}</td>
                        <td>{employees.at(user.person).address}</td>
                        <td>{employees.at(user.person).phoneNumber}</td>
                        <td>{employees.at(user.person).email}</td>
                        <td>{user.username}</td>
                        <td>{user.password}</td>
                        <td>{user.adminStatus}</td>
                        <td>
                            <button onClick={() => this.handleDelete(plant.id)}>Delete</button>
                            <button onClick={() => this.handleEdit(plant.id)}>Edit</button>
                        </td>
                    </tr>
                ))}
                </tbody>
            </table>
        </div>
    );
};

export default UserPage;
